const CTableBody = (props) => {
  const body = props.body;
  console.log(body);
  return (
    <>
      {body.map((row, i) => {
        return (
          <tr key={i}>
            <td>{row.id}</td>
            <td>{row.name}</td>
          </tr>
        );
      })}
    </>
  );
};
export default CTableBody;
